import React, { useState, Fragment } from 'react';
import Header from "../../components/Helpers/Header/Header";
import { BrowserRouter, Switch, Route } from "react-router-dom";
import TimeTable from "../../components/TimeTable/TimeTable";
import Announcements from "../../components/Announcements/Announcements";
import Profile from "./Profile";
import AdminSection from "../../components/AdminSection/AdminSection";
import AddStudentSection from "../../components/AdminSection/AddStudentSection/AddStudentSection";
import AddStudentMarksSection from "../../components/AdminSection/AddStudentMarksSection/AddStudentMarksSection";

const Dashboard = props => {
  const [ isDrawerOpen, setDrawerOpen ] = useState(false);
  const userType = "admin";
  return (
    <Fragment>
      <Header isDrawerOpen={isDrawerOpen} setDrawerOpen={setDrawerOpen} />
      <BrowserRouter>
        <Switch>
          <Route path={"/dashboard"} render={
            props => userType !== "admin" || userType === "examCell"
              ? <TimeTable { ...props } isDrawerOpen={isDrawerOpen} setDrawerOpen={setDrawerOpen} />
              : <AdminSection { ...props } isDrawerOpen={isDrawerOpen} setDrawerOpen={setDrawerOpen} />
          } exact />
          <Route path={"/dashboard/profile"} render={ props => <Profile { ...props } isDrawerOpen={isDrawerOpen} setDrawerOpen={setDrawerOpen} /> } />
          <Route path={"/dashboard/announcements"} render={ props => <Announcements { ...props } isDrawerOpen={isDrawerOpen} setDrawerOpen={setDrawerOpen} /> } />
          <Route path={"/dashboard/student/:action"} render={props => <AddStudentSection { ...props } isDrawerOpen={isDrawerOpen} setDrawerOpen={setDrawerOpen} />} exact />
          <Route path={"/dashboard/studentMarks/:action"} render={props => <AddStudentMarksSection { ...props } isDrawerOpen={isDrawerOpen} setDrawerOpen={setDrawerOpen} />} exact />
        </Switch>
      </BrowserRouter>
    </Fragment>
  )
};

export default Dashboard;
